import React, { Component } from "react";
import "./PostList.scss";

class PostList extends Component {
    render() {
        const messages = this.props.posts.map((msg, index) => (
            <p key={index}>{msg.data}</p>
        ));

        return (
            <div className="PostList">
                {messages}
            </div>
        );
    }
}

export default PostList;
